let candle = record.current
let volume = getElement('volumes', candle)
let len = 14 //length for sma calculation at Money Flow Ratio calculation
let FTs = 10 //sampling for the Fisher Transform


//calculate and store High Low Close average
variable.HLC.push((candle.max + candle.min + candle.close)/3)
if(variable.HLC.length > 2){
	variable.HLC.splice(0,1)
}

//raw moneyflow calculation
variable.RMF = (candle.max + candle.min + candle.close)/3 * (volume.buy + volume.sell)

//initializing Positive and Negative mone flow
if(variable.posMF === undefined){
		variable.posMF =0
}
if(variable.negMF === undefined){
		variable.negMF =0
}

//Positive Money flow calculation
if (variable.HLC[1] > variable.HLC[0]){
	variable.posMF = variable.posMF + variable.RMF
}
variable.PMF.push(variable.posMF) //store Positive money FLow for SMA calculation
if(variable.PMF.length > len){
	variable.PMF.splice(0,1)
}

//Negative Money flow calculation
if (variable.HLC[1] < variable.HLC[0]){
	variable.negMF = variable.negMF + variable.RMF
}
variable.NMF.push(variable.negMF) //store Negative money FLow for SMA calculation
if(variable.NMF.length > len){
	variable.NMF.splice(0,1)
}

//calculating SMA of nef and pos money flow
variable.sPMF = 0
variable.sNMF = 0
if(variable.NMF.length === len && variable.PMF.length === len){
	for(var i = 0 ; i < len ; i++) {
		variable.sPMF = variable.sPMF + variable.PMF[i]
		variable.sNMF = variable.sNMF + variable.NMF[i]
	}
	variable.smaPMF = variable.sPMF / len
	variable.smaNMF = variable.sNMF / len

	variable.MFR = variable.smaPMF / variable.smaNMF //Money FLow ratio
	variable.MFI = 100 - 100 /(1 + variable.MFR) //Money Flow Index
}

//handle initialization, undefined and NaN values at MFI
if(variable.MFI === undefined || isNaN(variable.MFI)){
	variable.MFI = 100
}
//store MFI values on th sampling range
variable.allMFI.push(variable.MFI)
if(variable.allMFI.length > FTs){
	variable.allMFI.splice(0,1)
}

//Procedure for Fisher Transform
//finding max and min MFI on the sampling range
variable.High = Math.max.apply(Math,variable.allMFI)
variable.Low = Math.min.apply(Math,variable.allMFI)

if(variable.prevValue === undefined) {
	variable.prevValue = 0
}
variable.Value = round(0.66 * ((variable.MFI - variable.Low)/ Math.max(variable.High - variable.Low, 0.001) - 0.5) + 0.67 + variable.prevValue)
variable.preValue = variable.Value

if(variable.prevFisher === undefined){
	variable.prevFisher = 0
}
variable.Fisher = 0.5 * Math.log((1 + variable.Value) / Math.max(1 - variable.Value,0.001)) + 0.5 * variable.prevFisher
if (isNaN(variable.Fisher)){
	variable.Fisher = 0
}
variable.Trigger = variable.prevFisher
variable.prevFisher = variable.Fisher


