}

let candle = record.current //define candle pointer
let v = 1 // variance for the gaussian distributed random number 
let iter = 1000 // number of iteration of the Monte Carlo simulation

//initialize lastClose array to avoid undefined or 0 value
if(variable.lastClose.length === 0 ){
	variable.lastClose.push(candle.close)
}

//fetch candle clos and previous candle close in an array
variable.lastClose.push(candle.close) 
if(variable.lastClose.length > 2) {
	variable.lastClose.splice(0,1)
}

//calculate and store Periode Daily Return on all time periods
variable.PDR.push(Math.log(variable.lastClose[1] / variable.lastClose[0]))

//statistic calculations of PDR
variable.totalPDR = 0
for(j=0 ; j < variable.PDR.length ; j++){
	variable.totalPDR += variable.PDR[j]
}
variable.avgPDR = variable.totalPDR / variable.PDR.length //average PDR

variable.prodvar = 0
		//variance and standard deviation calculations
for( var j = 0 ; j < variable.PDR.length ; j++){
	variable.prodvar = variable.prodvar + Math.pow(variable.PDR[j] - variable.avgPDR,2)
}

variable.varPDR = variable.prodvar / variable.PDR.length //variance
variable.sigPDR = Math.sqrt(variable.varPDR) //standard deviation

//Drift calculation
variable.drift = variable.avgPDR - variable.varPDR / 2

//Futur price array over iter number of values
variable.frct = []
for(var j = 0 ; j < iter ; j++){
	variable.frct.push(candle.close * Math.exp(variable.drift + random(v) * variable.sigPDR))
}

//average of futur price
variable.totalFRCT = 0
for(j=0 ; j < variable.frct.length ; j++){
	variable.totalFRCT += variable.frct[j]
}
variable.futur = variable.totalFRCT / variable.frct.length

//standard deviation of futur price
variable.prodvar = 0
for(var j = 0 ; j < variable.frct.length ; j++){
	variable.prodvar = variable.prodvar + Math.pow(variable.frct[j] - variable.futur,2)
}
variable.varFRCT = variable.prodvar / variable.PDR.length //variance
variable.stdF = Math.sqrt(variable.varFRCT) //standard deviation

//Min and Max futur price
variable.maxF = Math.max.apply(Math,variable.frct)
variable.minF = Math.min.apply(Math,variable.frct)

//half width at 1/e2 of futur price
variable.lowW = variable.futur - variable.stdF
variable.highW = variable.futur + variable.stdF

//Futur price at full width at half maximum value
variable.lowFWHM = variable.futur - Math.sqrt(2*Math.log(2)) * variable.stdF
variable.highFWHM = variable.futur + Math.sqrt(2*Math.log(2)) * variable.stdF

//Futur Begin and End
variable.BeginF = candle.begin + (candle.end - candle.begin)
variable.EndF = candle.end + (candle.end - candle.begin)

//function declaration
 //gaussian distributed random number generation
 function random(va){
	 var r = 0
	 for(var i = va ; i>0 ; i--){
		 r += Math.random()
	 }
	 return r/va
 }
